import { useRouter } from 'next/router'
import Link from 'next/link'
import data from '../../components/data.json';

export default () => {
  const router = useRouter()



  return (
    <>
      <h1>asdfsdfsdf</h1>
      <ul>
        {Object.entries(data).map((value, index) => {
          return (
            <li key={index}>
              <Link href='/blog/[dynamic]' as={'/blog/' + value[0]}>
                <a>{value[1].title}</a>
                <p>{value[1].content}</p>
              </Link>
            </li>
          )
        })}
      </ul>
    </>
  )
}
